#
# 设计一个包含一些单词的特殊词典，并能够通过前缀和后缀来检索单词。
# 
# 实现 WordFilter 类：
# 
# 
# WordFilter(string[] words) 使用词典中的单词 words 初始化对象。
# f(string prefix, string suffix) 返回词典中具有前缀 prefix 和后缀suffix
# 的单词的下标。如果存在不止一个满足要求的下标，返回其中 最大的下标 。如果不存在这样的单词，返回 -1 。
# 
# 
# 
# 
# 示例
# 
# 
# 输入：
# ["WordFilter", "f"]
# [[["apple"]], ["a", "e"]]
# 输出：
# [null, 0]
# 
# 解释：
# WordFilter wordFilter = new WordFilter(["apple"]);
# wordFilter.f("a", "e"); // 返回 0 ，因为下标为 0 的单词的 prefix = "a" 且 suffix = 'e"
# 。
# 
# 
# 
# 提示：
# 
# 
# 1 
# 1 
# 1 
# words[i]、prefix 和 suffix 仅由小写英文字母组成
# 最多对函数 f 进行 15000 次调用
# 
# 
#

# @lc code=start
class WordFilter:
    def __init__(self, words: list[str]):
        self.prefix_trie: tuple[set[int], dict] = (set(), {})
        w = { k: v for v, k in enumerate(words) }
        for word in w:
            i = w[word]
            curr = self.prefix_trie
            for char in word:
                if char not in curr[1]:
                    curr[1][char] = (set(), {})
                curr = curr[1][char]
                curr[0].add(i)

        self.suffix_trie = (None, {})
        for word in w:
            i = w[word]
            curr = self.suffix_trie
            for char in word[::-1]:
                if char not in curr[1]:
                    curr[1][char] = (set(), {})
                curr = curr[1][char]
                curr[0].add(i)


    def f(self, prefix: str, suffix: str) -> int:
        curr = self.prefix_trie
        for char in prefix:
            if char not in curr[1]:
                return -1
            curr = curr[1][char]
        prefix_set = curr[0]

        curr = self.suffix_trie
        for char in suffix[::-1]:
            if char not in curr[1]:
                return -1
            curr = curr[1][char]
        suffix_set = curr[0]

        both = prefix_set.intersection(suffix_set)
        return max(both) if both else -1

